import React from 'react';
import './btn-page-nav.scss';

const BtnPageNav = (props) => {
    return (
        <div className={'btn-page-nav btn-page-nav-' + props.color  + props.current?' btn-page-nav-current':""} >{props.text}</div>
    );
}

export default BtnPageNav;
